const fs = require('fs');
const path = require('path');

// Create a simple PNG favicon using base64 encoded data
// This is a 32x32 medical cross favicon in PNG format
const medicalCrossFaviconBase64 = `

`;

// Convert base64 to buffer and write to file
const medicalCrossFaviconBuffer = Buffer.from(medicalCrossFaviconBase64.trim(), 'base64');

// Write the favicon to the assets directory
const faviconPath = path.join(__dirname, 'assets', 'images', 'favicon.png');

try {
  fs.writeFileSync(faviconPath, medicalCrossFaviconBuffer);
  console.log('✅ Medical cross favicon created successfully!');
  console.log(`📁 Saved to: ${faviconPath}`);
  console.log('🌐 The favicon will be used automatically by Expo for web deployment.');
} catch (error) {
  console.error('❌ Error creating favicon:', error.message);
}